import React from 'react';
import { QRCode } from 'qrcode.react';

const QRCodeImage = ({ value, size = 128 }) => {
  return (
    <div className="p-2 bg-white rounded">
      <QRCode
        value={value}
        size={size}
        bgColor="#ffffff"
        fgColor="#000000"
        level="H"
        includeMargin={true}
      />
    </div>
  );
};

export default QRCodeImage;
